import "./App.css";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import Header from "./app/CommonComponents/Header";
function App() {
  return (
    <Router>
      <Header />
      <Route>
        <Route
          path="/home"
          element={<HomeComponent title={"Home Page Title"} />}
        />
        <Route path="/about" element={<About />} />
      </Route>
      <Footer />
    </Router>
  );
}

export default App;
